package workpad3

import kotlin.math.max
import kotlin.time.measureTime

fun karatsubaMultiply(num1: String, num2: String): String {
    if (num1.length <= 64 || num2.length <= 64) {
        return (num1.toBigInteger() * num2.toBigInteger()).toString()
    }
    val maxLength = max(num1.length, num2.length)
    val halfLength = (maxLength + 1) / 2
    val n1 = num1.padStart(maxLength, '0')
    val n2 = num2.padStart(maxLength, '0')
    val high1 = n1.substring(0, n1.length - halfLength)
    val low1 = n1.substring(n1.length - halfLength)
    val high2 = n2.substring(0, n2.length - halfLength)
    val low2 = n2.substring(n2.length - halfLength)
    val z0 = karatsubaMultiply(low1, low2)
    val z1 = karatsubaMultiply(addStrings(low1, high1), addStrings(low2, high2))
    val z2 = karatsubaMultiply(high1, high2)
    val result = addStrings(
        addStrings(
            z2 + "0".repeat(2 * halfLength),
            subtractStrings(z1, addStrings(z2, z0)) + "0".repeat(halfLength)
        ),
        z0
    )
    return result.trimStart('0').ifEmpty { "0" }
}
fun addStrings(num1: String, num2: String): String {
    val sb = StringBuilder()
    var carry = 0
    var i = num1.length - 1
    var j = num2.length - 1
    while (i >= 0 || j >= 0 || carry > 0) {
        val x = if (i >= 0) num1[i--] - '0' else 0
        val y = if (j >= 0) num2[j--] - '0' else 0
        val sum = x + y + carry
        sb.append(sum % 10)
        carry = sum / 10
    }
    return sb.reverse().toString()
}
fun subtractStrings(num1: String, num2: String): String {
    val sb = StringBuilder()
    var borrow = 0
    var i = num1.length - 1
    var j = num2.length - 1
    while (i >= 0 || j >= 0) {
        val x = if (i >= 0) num1[i--] - '0' else 0
        val y = if (j >= 0) num2[j--] - '0' else 0
        var diff = x - y - borrow
        if (diff < 0) {
            diff += 10
            borrow = 1
        } else {
            borrow = 0
        }
        sb.append(diff)
    }
    return sb.reverse().toString().trimStart('0').ifEmpty { "0" }
}
